cordova.define("com.jiedaibao.settitle.SetTitle", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       setTitle : function(title, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'SetTitle',
            'setTitle',
            [{
             "title": title
             }]
            );
       }
    }
  }
);
